def PatternCount(text, pattern):
    count = 0
    len_f_text = len(text)
    len_f_pattern = len(pattern)
    ran = len_f_text-len_f_pattern
    for p in range(0, ran+1):
        st_sl = text[p:p+len_f_pattern]
        if(st_sl == pattern):
            count = count+1
    return count


def FrequentWords(text, k):
    kmers = set()
    for i in range(0, len(text)-k+1):
        kmers.add(text[i:i+k])
    freq = set()
    for i in kmers:
        freq.add((i, PatternCount(text, i)))
    maxmers = {}
    max_sq = max(freq, key=lambda a: a[1])
    for i in freq:
        if i[1] == max_sq[1]:
            maxmers[i[0]] = i[1]
    return maxmers


def ReverseComplement(Pattern):
    rev_pat = ""
    for i in Pattern:
        if i == "A":
            rev_pat += "T"
        elif i == "G":
            rev_pat += "C"
        elif i == "C":
            rev_pat += "G"
        elif i == "T":
            rev_pat += "A"
    rev_pat = list(rev_pat)
    rev_pat.reverse()
    rev_pat = "".join(rev_pat)
    with open("answer.txt","w+") as f:
        f.write(rev_pat)
    return rev_pat


