def PatternMatching(Pattern, Genome):
    gen_len = len(Genome)
    pat_len = len(Pattern)
    ind = []
    for i in range(gen_len-pat_len):
        if Genome[i:i+pat_len] == Pattern:
            ind.append(i)
    with open("answer.txt","w+") as f:
        st = ""
        for i in ind:
            st += " " + str(i)  
        f.write(st)
    print(*ind)

